import studio from "../1x1.png";
import twoBedroom from "../2x2.png";



const QuickLook = () => {

    return (
        <div>
            <h1>Floor plans</h1>
            <img src={studio} />
            <img src={twoBedroom} />
        </div>
    );

}

export default QuickLook;
